import React from 'react';
import { StyledAlert } from "./styles";

export interface IAlert {
  children: React.ReactNode;
  marginTop?: number;
  marginBottom?: number;
  className?: string;
}

const Alert: React.FC<IAlert> =
  ({ children,
     marginTop,
     marginBottom,
     className }) => {
  return (
    <StyledAlert className={className} marginTop={marginTop} marginBottom={marginBottom}>
      {children}
    </StyledAlert>
  )
}

export default Alert;
